questionvariables.text:
aa:1+rand(5);
bb:rand_with_prohib(1,5,[aa]);
cc : (-1)^(bb);
dd : cc*bb;
exp1: (x-aa)*(x-dd);
exp : expand(exp1);
ta1:aa;
ta2:dd;

aa:1+rand(5)
bb:1+rand(5)
exp1: (2*x-aa)*(3*x-bb);
exp: expand(exp1);
ta1:aa/2
ta2:bb/3

aa: rand(5)+2;
r1:1/aa;
r2: rand_with_prohib(0,8,[r1]);
exp:expand(aa*(x-r1)*(x-r2));
ta:solve(exp,x);
ta1:rhs(ta[1]);
ta2:rhs(ta[2]);
bb:-aa*(r1+r2);
cc: aa*r1*r2;

aa: rand(5)+2;
r1:1/aa;
r2: rand_with_prohib(0,8,[r1]);
exp:expand(aa*(x-r1)*(x-r2));
ta:setify(solve(exp,x));
bb: -aa*(r1+r2);
cc:aa*r1*r2;
